import React from "react";
import logoIcon from "./images/logo-icon.png";
import lightLogo from "./images/logo-light-text.png";
import lightIcon from "./images/logo-light-icon.png";
import user from "./images/orgxtopaz.png";
import $ from "jquery";
import parse from "html-react-parser";
import { useHistory } from "react-router-dom"; // allows us to access our path / route history.
import Axios from "axios"; //allows us to make GET and POST requests from the browser.
import { useEffect } from "react"; //a hook that GIVES  "side-effects"


function Home() {
  let history = useHistory(); //USE HISTORY  it will DETERMINED OUR PAST PATH.


function Withdraw(){
      alert("Withdrawal in process of making")
  }
function Deposit(){
      alert("Deposit in process of making")
  }

  const isLoaded = [true];
  useEffect(() => {

     if (isLoaded) {
      Axios.post("http://localhost:5000/login", 

      { 
        
        
        email: localStorage.getItem("email"),
        password: localStorage.getItem("password")
      
      }
      
      )
   
      .then((res) => {
        if(res.data.position ==="user"){ 
    
        }
      else{
        history.push("/")
        window.location.reload();  
      }

     
      })
      .catch((error) => {
        history.push("/")


      })

    }else{
      console.log("ERROR")
    }


  }, isLoaded);
  function Logout(){
    localStorage.clear()
    window.location.reload()
  }
  return (
    <div>
      {/* ============================================================== */}
      {/* Preloader - style you can find in spinners.css */}
      {/* ============================================================== */}
      <div className="preloader">
        <div className="lds-ripple">
          <div className="lds-pos" />
          <div className="lds-pos" />
        </div>
      </div>
      {/* ============================================================== */}
      {/* Main wrapper - style you can find in pages.scss */}
      {/* ============================================================== */}
      <div
        id="main-wrapper"
        data-layout="vertical"
        data-navbarbg="skin5"
        data-sidebartype="full"
        data-sidebar-position="absolute"
        data-header-position="absolute"
        data-boxed-layout="full"
      >
        {/* ============================================================== */}
        {/* Topbar header - style you can find in pages.scss */}
        {/* ============================================================== */}
        <header className="topbar" data-navbarbg="skin5">
        <div className="card-block"  style={{display:"flex",margin: "10px", padding: "20px",marginTop:"0%",backgroundColor:""}} >
                            <h4 className="card-title">Deposit</h4>
                            
                            <h2 style={{fontSize: '1.4em',marginTop:"19px",marginLeft:"-50px"}}>
                        

                              <i className="mdi mdi-cloud-download"  />
                            </h2>
                          
                            <h4 className="card-title" style={{marginTop:"1px",marginLeft:"50px"}}>Withdraw</h4>
                            <h2 style={{fontSize: '1.4em',marginTop:"19px",marginLeft:"-65px"}}>
                              <i className="mdi mdi-cloud-upload"  />
                            </h2>
                         
                          </div>
          <nav className="navbar top-navbar navbar-expand-md ">
            <div className="navbar-header" data-logobg="skin5">
              
              {/* ============================================================== */}
              {/* Logo */}
              {/* ============================================================== */}
              <a className="navbar-brand" href="/" style={{backgroundColor:"#03A9F4"}}>
                
                {/* Logo icon */}
                <b className="logo-icon">
                  {/* Dark Logo icon */}
                  <img
                    src="https://i.scdn.co/image/ab6761610000e5ebc02d416c309a68b04dc94576"
                    alt="homepage"
                    className="dark-logo"
                  />
                  {/* Light Logo icon */}
                </b>
                {/*End Logo icon */}
                {/* Logo text */}
                <span className="logo-text">
                  {/* dark Logo text */}
                  <img src={logoIcon} alt="homepage" className="dark-logo" />
                  {/* Light Logo text */}
                  {/* <img src={lightLogo}  style={{width:""}}className="light-logo" alt="homepage" /> */}
                </span>
              </a>
              {/* ============================================================== */}
              {/* End Logo */}
              {/* ============================================================== */}
              {/* This is for the sidebar toggle which is visible on mobile only */}
              <a
                className="nav-toggler waves-effect waves-light d-block d-md-none"
                href="javascript:void(0)"
              >
                <i className="ti-menu ti-close" />
              </a>
            </div>
            {/* ============================================================== */}
            {/* End Logo */}
            {/* ============================================================== */}
            <div
              className="navbar-collapse collapse"
              id="navbarSupportedContent"
              data-navbarbg="skin5"
            >
              {/* ============================================================== */}
              {/* toggle and nav items */}
              {/* ============================================================== */}

              {/* ============================================================== */}
              {/* Right side toggle and nav items */}
              {/* ============================================================== */}
            </div>
          </nav>
        </header>
        {/* ============================================================== */}
        {/* End Topbar header */}
        {/* ============================================================== */}
        {/* ============================================================== */}
        {/* Left Sidebar - style you can find in sidebar.scss  */}
        {/* ============================================================== */}
        <aside className="left-sidebar" data-sidebarbg="skin6">
          {/* Sidebar scroll*/}
          <div className="scroll-sidebar">
            {/* Sidebar navigation*/}
            <nav className="sidebar-nav">
              <ul id="sidebarnav">
                {/* User Profile*/}
                <li>
                  {/* User Profile*/}
                  <div className="user-profile d-flex no-block dropdown m-t-20">
                    <div className="user-pic">
                      <img
                        src={user}
                        alt="users"
                        className="rounded-circle"
                        width={40}
                      />
                    </div>
                    <div className="user-content hide-menu m-l-10">
                      <a
                        href="#"
                        className
                        id="Userdd"
                        role="button"
                        data-bs-toggle="dropdown"
                        aria-haspopup="true"
                        aria-expanded="false"
                      >
                        <h5 className="m-b-0 user-name font-medium">
                          Orgxtopaz <i className="fa fa-angle-down" />
                        </h5>
                        <span className="op-5 user-email">
                          orgxtopaz@gmail.com
                        </span>
                      </a>
                      <div
                        className="dropdown-menu dropdown-menu-end"
                        aria-labelledby="Userdd"
                        onClick={Logout}
                      >
                        <a className="dropdown-item" href="javascript:void(0)">
                          <i className="fa fa-power-off m-r-5 m-l-5" /> Logout
                        </a>
                      </div>
                    </div>
                  </div>
                  {/* End User Profile*/}
                </li>

                {/* User Profile*/}
                <li className="sidebar-item">
                  {" "}
                  <a
                    className="sidebar-link waves-effect waves-dark sidebar-link"
                    href="/userBusiness"
                    aria-expanded="false"
                  >
                    <i className="mdi mdi-newspaper" />
                    <span className="hide-menu">Business</span>
                  </a>
                </li>
            
              </ul>
            </nav>
            {/* End Sidebar navigation */}
          </div>
          {/* End Sidebar scroll*/}
        </aside>
        {/* ============================================================== */}
        {/* End Left Sidebar - style you can find in sidebar.scss  */}
        {/* ============================================================== */}
        {/* ============================================================== */}
        {/* Page wrapper  */}
        {/* ============================================================== */}
        <div className="page-wrapper">
          {/* ============================================================== */}
          {/* Bread crumb and right sidebar toggle */}
          {/* ============================================================== */}
          <div className="page-breadcrumb">
            <div className="row align-items-center">
              <div className="col-5">
                <div className="d-flex align-items-center">
                  <nav aria-label="breadcrumb">
                    <ol className="breadcrumb">
                      <li className="breadcrumb-item">
                        <a href="#">Home</a>
                      </li>
                      <li
                        className="breadcrumb-item active"
                        aria-current="page"
                      >
                        Overview
                      </li>
                    </ol>
                  </nav>
                </div>
              </div>
            </div>
          </div>
          {/* ============================================================== */}
          {/* End Bread crumb and right sidebar toggle */}
          {/* ============================================================== */}
          {/* ============================================================== */}
          {/* Container fluid  */}
          {/* ============================================================== */}
          <div className="container-fluid">
            {/* ============================================================== */}
            {/* Sales chart */}
            {/* ============================================================== */}
            <div className="row">
              <div className="col-md-8">
                <div className="card">
                  <div className="card-body">
                    <div className="d-md-flex align-items-center">
                      <div>
                        <h4
                          className="card-title"
                          style={{ textAlign: "left" }}
                        >
                          Account Overview
                        </h4>
                        <h5 className="card-subtitle">Latest overview</h5>
                      </div>
                    </div>
                    <div className="row my-3">
                      <div className="col-md-4">
                        <div className="card text-center h-20">
                          <div className="card-block">
                            <h4 className="card-title" style={{fontFamily: 'Helvetica'}}>Josef Coin  <span class="mdi mdi-coins"  style={{fontSize: '1em'}}></span>     </h4>
                         
                            
                          </div>
                          <div className="row px-2 no-gutters">
                            <div className="col-6">
                              <h3
                                className="card card-block border-top-0 border-left-0 border-bottom-0"
                                style={{ width: "177%" }}
                              >
                                                         <span style={{fontFamily: 'Helvetica'}}> 4</span>

                              </h3>
                            </div>
                          </div>
                        </div>
                      </div>
                      <div className="col-md-4">
                        <div className="card text-center h-20">
                          <div className="card-block">
                            <h4 className="card-title" style={{fontFamily: 'Helvetica'}}>Miguel Coin  <span class="mdi mdi-coins"  style={{fontSize: '1em'}}></span>     </h4>
                         
                            
                          </div>
                          <div className="row px-2 no-gutters">
                            <div className="col-6">
                              <h3
                                className="card card-block border-top-0 border-left-0 border-bottom-0"
                                style={{ width: "177%" }}
                              >
                                                           <span style={{fontFamily: 'Helvetica'}}> 4</span>

                              </h3>
                            </div>
                          </div>
                        </div>
                      </div>
                      <div className="col-md-4">
